import React from "react";
import "./App.css";

class Button extends React.Component {
    render() {
        return (
            <div id>
                <div class="navs" id="academics">
                    Faculty
                </div>
                <div class="navs" id="academics">
                    Academics
                </div>
            </div>
        )
    }
}

class Template extends React.Component {
    render() {
        return (
            <div id="container">
                <div id="nav-bar">
                    < Button />
                </div>
                <div id="logo"></div>
                <footer>
                    <div id="address"></div>
                </footer>
            </div>
        )
    }
}

export default Template;
